import Home from  "./Home"

const BASE_URL = 'https://api.apilayer.com/email_verification/customercare@apilayer.com';
const btnListarClientesId = document.getElementById('btnListarClientesId');
const ListandoCliente = () =>{
    return(
        btnListarClientesId.addEventListener('click', (event) =>{
            async id =>{
                try{
                    const response = await fetch(BASE_URL);
                    const data = await response.json;
                    console.log(data);
                }catch(e){
                    console.log("Sua api está com problemas, entre em contato com o técnico adminsitrador do sistema." + e)
                }
            }
        })
    )
}
export default ListandoCliente;
